import React from 'react';

function Registro() {
  // Datos de ejemplo para la tabla
  const data = [
    { id: 1, nombre: 'Ejemplo 1', edad: 30 },
    { id: 2, nombre: 'Ejemplo 2', edad: 25 },
    { id: 3, nombre: 'Ejemplo 3', edad: 35 },
    // Agrega más datos según sea necesario
  ];

  return (
    <div>
      <h1>Tabla de Registro</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nombre</th>
            <th>Edad</th>
            <th>Editar</th>
            <th>Eliminar</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.nombre}</td>
              <td>{item.edad}</td>
              <td>
                <button onClick={() => (item.id)}>Editar</button>
              </td>
              <td>
                <button onClick={() => (item.id)}>Eliminar</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Registro;
